import React from 'react';
import {Grid, Cell, List, ListItem} from 'react-mdl';

class Contacts extends React.Component{
    render(){
     return(
        <div>
           <div >
               <Grid>
                <Cell col={12} className='contacts'>
                 <h1 className='tc f1 line'>CONTACTS</h1>
                 <div className='w4 br-pill bw3 center bt b--light-gray'></div>
                 <Grid>
                     <Cell col={6}>
                     <List className='flex'>
                    <ListItem>Bryan Cranston</ListItem>
                    <ListItem>Aaron Paul</ListItem>
                    <ListItem>Bob Odenkirk</ListItem>
                </List>
                     </Cell>
                 </Grid>

                </Cell>
               </Grid>

           </div>
        </div>
    )
    }
}

export default Contacts;
